CREATE TABLE `SubCategory` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `CategoryId` int(11) NOT NULL COMMENT '부모 카테고리 ID',
  `Name` varchar(255) NOT NULL COMMENT '이름',
  `DisplayName` varchar(255) NOT NULL COMMENT '표시이름',
  `IconPath` varchar(255) NOT NULL COMMENT '표시 아이콘 경로 /*FontAwesome 사용*/',
  `Action` varchar(255) NOT NULL COMMENT '접근 MVC Action 명 /*이 값이 없으면 하위 카테고리 존재*/',
  `Role` varchar(255) NOT NULL DEFAULT 'Admin' COMMENT '접근 권한 설정',
  `Order` int(11) NOT NULL COMMENT '출력 순서',
  PRIMARY KEY (`Id`),
  KEY `SubCategory_FK` (`CategoryId`),
  CONSTRAINT `SubCategory_FK` FOREIGN KEY (`CategoryId`) REFERENCES `Category` (`Id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `SubCategory_Role_check` CHECK (`Role` = 'Admin' or `Role` = 'User')
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8mb3 COMMENT='서브 카테고리 /*MyLaboratory.WebSite의 로그인 후 접근 가능한 좌측 SideBar 설정 시 사용*/';
